<?php
//$nas_conf = parse_ini_file('/etc/nas.conf', TRUE);/*
$ini_iso88591 = file_get_contents('/etc/nas.conf');
$convert = explode("\n", $ini_iso88591);
$content = '';

for ($i=0;$i<count($convert);$i++)  
{
	$line ='';
	$line1 ='';
	$line2 ='';
	if(preg_match("/[\w\W]*\s=/",$convert[$i],$matches)){
		$line1 = $matches[0]; //write value by index		
	}
	
	if(preg_match("/\= [\s]*[\w\W]*[\s][\w\W]*/",$convert[$i],$matches)){
		$line2 = $matches[0];
		$line2 = str_replace("=","",$line2);
		$line2 = '"'.$line2.'"';
	}
	elseif(preg_match("/\= [\w\W]*/",$convert[$i],$matches)){
		$line2 = $matches[0];
		$line2 = str_replace("=","",$line2);
	}
	
	$line = $line1.$line2."\n";
	$content .= $line;	
}

//file_put_contents("/volume1/.@tmp/nas.conf", $line, FILE_APPEND);

if (!$content) {echo('get content failed');}
$ini_utf8 = iconv("ISO-8859-1", "UTF-8", $content);


if (!$ini_utf8) {echo('iconv failed');}
$nas_conf = parse_ini_string($ini_utf8, TRUE);

if (!$nas_conf) {echo('parse failed');}

if ($nas_conf['HttpsOnly']) {
    $schema = 'https://';
    $port   = $nas_conf['HttpsPort'];
}
elseif ($nas_conf['EnableHttps'] && isset($_SERVER["HTTPS"])) {
    $schema = 'https://';
    $port   = $nas_conf['HttpsPort'];
}
else {
    $schema = 'http://';
    $port   = $nas_conf['HttpPort'];
}

$url = $schema . $_SERVER['SERVER_NAME'] . ':' . $port;

?>
